import React, {useState} from "react";

function NewVenueForm() {
  const [vname, setVName] = useState("");
  const [vcity, setVCity] = useState("");
  const [vimage_link, setVImage_link] = useState("");


  function handleVenueSubmit(event) {
    const formData = {
      name: vname,
      city: vcity,
      image_link: vimage_link,
    };
    console.log(formData);
    event.preventDefault();
    fetch('http://localhost:9292/venues', {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(formData),
    });}


 return (
    <form onSubmit={handleVenueSubmit}  class="mb-3" className="new-venue-form"> 
     <input value={vname}
  onChange={(e) => setVName(e.target.value)} placeholder="NAME" />
     <input value={vcity}
  onChange={(e) => setVCity(e.target.value)} placeholder="CITY" />
     <input value={vimage_link}
  onChange={(e) => setVImage_link(e.target.value)} placeholder="IMAGE_LINK" />
      <input type="submit" value="POST VENUES" />
</form>

);
}

export default NewVenueForm;
